使用一个私有成员来保证一个结构体可以在不破坏稳定性的情况下实现扩展. mod a { pub struct S { pub foo: i32, bar: i32, }
} fn func(s: a::S) { // 因为 bar 是私有成员, 使用如 // let a::S { foo: _, bar: b } = s; // 的结构语法时提示 bar 为私有成员, 因此我们 // 使用 `..` 来跳过这个私有成员 let a::S { foo: _, .. } = s;
} 在结构体中添加一个成员通常是向后兼容的. 但这会导致原有模式匹配解构该结构体时抛出没有完全匹配成员的错误. 你可以使用私有成员和在模式匹配使用 .. 来跳过一些成员, 即使添加了新的成员, 原有的模式匹配也不会被破坏. 使用这种方法的坏处是需要在结构体中添加不需要的成员, 可以把该成员的类型设置为 () 以避免运行时消耗, 并在成员名前添加 _ 避免编译器抛出变量未使用的警告.

