使用 Deref 特性可以让数据集合被当作智能指针, 提供拥有所有权和借用的数据视图. struct Vec<T> { ...
} impl<T> Deref for Vec<T> { type Target = [T]; fn deref(&self) -> &[T] { ... }
} Vec<T> 拥有一些 T 所有权, 一个 &[T] 切片是一些 T 的借用. 为 Vec 实现 Deref 允许隐式地将 &Vec<T> 转换为 &[T], 同时也包括了自动解索引的关系. 大多数你希望 Vec 实现的函数实际上是为切片实现的. 一个最常见的例子就是 String 和 &str. 更深入的讨论可以参考 原文

