Rust 没有 finally 语句块, 即无论函数怎样终止都会执行的语句块, Rust 提供了 Drop 特性来定义对象在析构时需要运行的代码. struct Foo; impl Drop for Foo { fn drop(&mut self) { println!("exit"); }
} fn func() -> Result<(), ()> { Ok(()) // Err(())
} fn use_foo() -> Result<(), ()> { // use_foo 运行完成后将会调用 `Drop` // 实现的析构方法, 因此会打印 "exit" // 注意: 即使 func 失败了仍然会调用 // 析构方法 let _exit = Foo; func()?; Ok(())
} fn main() { use_foo().unwrap();
} 值得注意的是 Rust 的 Drop 并不如 finally 那样值得信赖, 因为 Drop 中的代码在某些情况下可能不会运行(如 panic 的线程), 甚至会引发其他问题, 在 too many linked list 中的一个例子. 参考 Drop - doc Drop - Rust Book RAII

