正如其名, Default 提供了某个类型或结构体的默认值, 大多数基本类型都实现了 Default, 对于复合类型如 Cow<T>, Box<T> 或 Arc<T>, 如果 T 实现了 Default, 则将会自动实现对应复合类型的 Default. 对于结构体, 如果结构体的每个成员都实现了 Default, 则可以使用 #[derive(Default)] 自动实现. Default 与手动实现的构造方法(通常是 new)不同的是 Default 没有参数而且只能有一个实现, 手动实现的构造方法更加灵活, 可以拥有多个参数和不同实现. #[derive(Default, Debug)]
struct Foo { data: i32,
} fn main() { print!("Default value of Foo: {:#?}", Foo::default());
}

