假设有如下枚举类型 enum MyEnum { A { name: String, x: u8 }, B { name: String },
} 假设你想在 x = 0 时将 A 转换为 B, 同时保持 B完整. 最直接的想法是使用 clone, 但我们还可以使用 std::mem::replace 减少 clone use std::mem; enum MyEnum { A { name: String, x: u8 }, B { name: String }
} fn a_to_b(e: &mut MyEnum) { // we mutably borrow `e` here. This precludes us from changing it directly // as in `*e = ...`, because the borrow checker won't allow it. Therefore // the assignment to `e` must be outside the `if let` clause. *e = if let MyEnum::A { ref mut name, x: 0 } = *e { // this takes out our `name` and put in an empty String instead // (note that empty strings don't allocate). // Then, construct the new enum variant (which will // be assigned to `*e`, because it is the result of the `if let` expression). MyEnum::B { name: mem::replace(name, String::new()) } // In all other cases, we return immediately, thus skipping the assignment } else { return }
} 在处理链表时, 使用 std::mem::replace 可以减少很多繁琐的处理 Option clone 代码. 推荐阅读 too many linked list 更多介绍请参考 原文

