多条批量回复是由多个回复组成的数组， 数组中的每个元素都可以是任意类型的回复， 包括多条批量回复本身。 多条批量回复的第一个字节为 "*" ， 后跟一个字符串表示的整数值， 这个值记录了多条批量回复所包含的回复数量， 再后面是一个 CRLF 多条批量回复其实是对上面四种回复的嵌套, 但需要注意"空白多条批量回复"和"无内容多条批量回复"这两种特殊情况. 空白多条回复为 "*0
", 无内容多条批量回复为 "*-1
", 在解析时需要对这两种特殊情况进行处理. 在其他情况则可以应用 nom 提供的 alt 组合子服用之前的四个解析函数; alt 即"可选的", 它接受多个解析函数元组, 依次尝试应用每个函数, 返回第一个成功解析结果或抛出错误. 同时对于重复应用某个解析函数 m 到 n 次这种模式, nom 提供了 many_m_n 组合子, 对于 fn parse_item(&str) -> IResult<&str, Reply> 这样的函数, many_m_n(parse_item, 0, 12) 返回值为 IResult<&str, Vec<Reply>>. 理清逻辑后解析多条批量回复的解析函数虽然有些长但还是很清晰的: fn parse_multi_batch(i: &str) -> IResult<&str, Reply> { let (i, count) = delimited( tag("*"), take_while1(|c: char| c.is_digit(10) || c == '-'), tag("
"), )(i)?; if count == "-1" { let (i, _) = tag("
")(i)?; Ok((i, Reply::MultiBatch(None))) } else { let count = count.parse::<usize>().unwrap(); let (i, responses) = many_m_n( count, count, alt((parse_single_line, parse_err, parse_int, parse_batch)), )(i)?; // 做个严格检查, 检查解析到的个数与预期的是否一致 if responses.len() != count { Ok(( i, Reply::BadReply(format!("expect {} items, got {}", count, responses.len())), )) } else { Ok((i, Reply::MultiBatch(Some(responses)))) } }
} 最后用 alt 做个"汇总" fn parse(i: &str) -> IResult<&str, Reply> { alt(( parse_single_line, parse_err, parse_int, parse_batch, parse_multi_batch, ))(i)
} 至此我们我们的解析函数到完成了, 为 Reply 实现 Display 特性后对 redis 返回的消息应用 parse 然后把解析结果打印出来即可验证解析函数正确性. 完整代码在 rrdis-cli/src/reply.rs

