字符串（string）是由双引号包围的任意数量Unicode字符的集合，使用反斜线转义。一个字符（character）即一个单独的字符串（character string） 字符串描述 从图中可以看到左引号之后有3种情况, 最特殊的情况为两个引号之间无任何元素, 即空字符, 其他两种情况我们可以使用 delimited 去掉两端的引号, 拿到字符串内容. fn string(i: &str) -> IResult<&str, &str> { context( "string", alt((tag("\"\""), delimited(tag("\""), parse_str, tag("\"")))), )(i)
} 这里使用 context 为我们解析提供了一个上下文信息, 因为 parse_str 函数比较复杂, 涉及很多基本解析, 容易与数值, 数组, 对象等解析错误抛出的信息混淆, 添加一个上下文环境可让让我们方便地知道是在解析 string 时出了问题. 之后的测试中将会展示 context 为我们提供的额外信息. 现在我们要实现关键的 parse_str 函数, 我们面临的最大难题是处理转义字符, nom 同样为我们提供了处理转义字符的函数 escaped. 这个函数签名为 escaped(normal, control, escapable), 即接受三个参数, normal 为判断普通字符函数, 必须不含有控制符 control, escapable 则是可以转义的字符. 官方文档的例子可以更形象地展示其用法: use nom::bytes::complete::escaped;
use nom::character::complete::one_of; fn esc(s: &str) -> IResult<&str, &str> { escaped(digit1, '\\', one_of(r#""n\"#))(s)
} assert_eq!(esc("123;"), Ok((";", "123")));
assert_eq!(esc(r#"12\"34;"#), Ok((";", r#"12\"34"#))); 所以 parse_str 可以这样实现: fn parse_str(i: &str) -> IResult<&str, &str> { escaped(normal, '\\', escapable)(i)
} normal 同样是一个解析函数, 按照标准中描述的 Any codepoint except " or \ or control characters 我们只需要一直消耗输入, 直到碰上 " \ 或控制字符, take_till1 就可以实现我们的需求, 它与 take_while 用法相似. fn normal(i: &str) -> IResult<&str, &str> { take_till1(|c: char| c == '\\' || c == '"' || c.is_ascii_control())(i)
} 注意, 这里使用了 take_till1, 即至少需要消耗1个char, 如果使用 take_till, 会导致 escaped 内部无限循环, 感兴趣的可以查看 escaped实现源码 . 处理可转义字符的 escapable 函数除了处理16进制稍微麻烦点外, 可以使用 alt 和 tag 实现. fn escapable(i: &str) -> IResult<&str, &str> { context( "escaped", alt(( tag("\""), tag("\\"), tag("/"), tag("b"), tag("f"), tag("n"), tag("r"), tag("t"), parse_hex, )), )(i)
} fn parse_hex(i: &str) -> IResult<&str, &str> { context( "hex string", preceded( peek(tag("u")), take_while_m_n(5, 5, |c: char| c.is_ascii_hexdigit() || c == 'u'), ), )(i)
} parse_hex 使用了 peek, 这个函数的不同之处在于它会尝试对输入应用解析函数, 而不消耗输入. 以上面的代码为例, 假设输入为 i = "u1234", peek(tag("u") 应用之后传入 take_while_m_n 的输入依然为 "u1234", 若只使用tag("u"), take_while_m_n 接收到的只有 1234.

