值（value）可以是双引号括起来的字符串（string）、数值(number)、true、false、 null、对象（object）或者数组（array）。这些结构可以嵌套。 值描述 可以看到值的解析比较简单, 空白,字符串和数字的解析我们都已经完成了, 剩下的只有基本类型 true, false 和 null 以及复合类型 object 和 array. 先完成基本类型解析 fn boolean(i: &str) -> IResult<&str, bool> { let parse_true = n_value(true, tag("true")); let parse_false = n_value(false, tag("false")); alt((parse_true, parse_false))(i)
} fn null(i: &str) -> IResult<&str, JsonValue> { map(tag("null"), |_| JsonValue::Null)(i)
} 在解析布尔值时使用了 n_value, 它其实是 nom::combinator::value, 只不过被我重命名为 n_value, 这个函数会在子解析成功时返回提供的值, 以上面代码为例, 如果 tag("true") 成功, 那么 n_value(true, tag("true")) 将返回 true. object 和 array 的实现暂时不管, 值的解析可以写为 fn value(i: &str) -> IResult<&str, JsonValue> { context( "value", delimited( multispace0, alt(( map(object, JsonValue::Object), map(array, JsonValue::Array), map(string, |s| JsonValue::Str(String::from(s))), map(double, JsonValue::Num), map(boolean, JsonValue::Boolean), null, )), multispace0, ), )(i)
} 在实现 value 时使用了一个小 trick, map 的第二个参数应该是一个匿名函数, 如 map(string, |s| JsonValue::Str(String::from(s))) 这样的写法, 但 Rust 枚举成员构造函数本身就是一个匿名函数, 所以 map(double, |num: f64| JsonValue::Num(num)) 可以简化为 map(double, JsonValue::Num).

