对象是一个无序的“‘名称/值’对”集合。一个对象以 {左括号 开始， }右括号 结束。每个“名称”后跟一个 :冒号 ；“‘名称/值’ 对”之间使用 ,逗号 分隔。 对象描述 对象结构与数组类似, 不同的是我们需要解析键和值, 然后把他们拼接起来. 先实现键的解析. fn key(i: &str) -> IResult<&str, &str> { delimited(multispace0, string, multispace0)(i)
} 值解析我们已经实现, 现在需要把他们拼起来 fn object(i: &str) -> IResult<&str, HashMap<String, JsonValue>> { context( "object", delimited( tag("{"), map( separated_list( tag(","), separated_pair(key, tag(":"), delimited(multispace0, value, multispace0)), ), |tuple_vec: Vec<(&str, JsonValue)>| { tuple_vec .into_iter() .map(|(k, v)| (String::from(k), v)) .collect() }, ), tag("}"), ), )(i)
} object 实现有些复杂, 最外层的 delimited 去掉左右大括号, 接着用 map 对 separated_list 解析得到的 Vec<(&str, JsonValue)> 进行转换, 得到预期的 Hashmap<String, JsonValue>. 对于每个键值对我们都用 separated_pair 去掉分隔符, 得到键值. 最后需要对顶层结构进行解析, 一个顶层结构类型只能是对象或数组 fn root(i: &str) -> IResult<&str, JsonValue> { delimited( multispace0, alt((map(object, JsonValue::Object), map(array, JsonValue::Array))), multispace0, )(i)
}

