在之前 open-link 基础上可以我们可以先拼接出某个搜索引擎的 url, 接着通过浏览器打开那个 url, 即可实现搜索功能。因为不同搜索引擎搜索结果差异较大，所以需要提供多个搜索引擎，由 --engine 选项传入。 因为 --engine 参数值有限，我们通过将它的类型设置为某个枚举类型即可(PowerShell 支持枚举类型) enum SearchEngine { Doge Bing Google Baidu
} function search-thing { <# .Description 使用浏览器搜索 #> param ( # 搜索关键字 [parameter(Mandatory = $true, ValueFromPipeline = $true)] [string] $keyword, # 指定搜索引擎 [SearchEngine] $engine = [SearchEngine]::Doge ) switch ($engine) { { [SearchEngine]::Doge } { $url = "https://www.dogedoge.com/results?q=$keyword"; break } { [SearchEngine]::Bing } { $url = "https://cn.bing.com/search?q=$keyword"; break } { [SearchEngine]::Google } { $url = "https://google.com/search?q=$keyword"; break } { [SearchEngine]::Baidu } { $url = "https://www.baidu.com/s?wd=$keyword"; break } Default { $url = "https://www.dogedoge.com/results?q=$keyword" } } open-link $url
} 可以看到整个函数并不复杂，先定义一个为参数准备的枚举类型，接着匹配 $engine 拼接 url，最后通过 open-link 打开 url。 还有一个值得注意的点是， $keyword 参数添加了额外的指令 ValueFromPipeline = $true, 这意味着可以通过 echo "github" | search-thing 这样的管道传递参数

