现在我们几乎了解了 mod，那 use 呢？ use 的唯一目的是 将符号带入命名空间 ，让符号使用更加简短。 特别是，use 永远不会告诉编译器去编译 mod 导入文件之外的其他文件 。 在 main.rs/math.rs 例子中，在 src/main.rs 写下如下语句时： mod math; 我们在主模块导入一个名为 math 模块，这个模块导出 add 函数。 从范围角度，结构如下： crate 主模块(我们在这儿) `math` 模块 `add` 函数 这就是为什么我们要使用 add 函数时要这样引用 math::add，即从主模块到 add 函数的正确路径。 请注意，如果我们从另一个模块调用 add，那么 math::add 可能不是有效路径。 然而，add 有一个更长的添加路径，即 crate::math::add - 它在我们的 crate 中的任何位置都有效（只要 math 模块保持原样）。 所以，如果我们不想每次都使用 math:: 前缀调用 add，可以用 use 指令： mod math;
use math::add; fn main() { // 看，没有前缀了！ let result = add(1, 2); println!("1 + 2 = {}", result);
}

