好吧，同级模块（如 add 和 sub）之间没有直接访问的路径。 如果想在 add 中重新定义 sub，我们在 src/math/sub.rs 不能这样做： // 编译不通过
pub fn sub(x: i32, y: i32) -> i32 { add::add(x, -y)
} add 和 sub 共享父级模块，但不意味他们共享命名空间。 我们也绝对不应该使用第二个 mod。 add 模块已存在于模块层次结构中的某个位置。 除此之外 - 因为它是 sub 的子模块，它要么存在于 src/math/sub/add.rs 或 src/math/sub/add/mod.rs 中 - 这两者都没有意义。 如果我们想访问 add， 必须通过父级模块，就像其他人一样。在 src/math/sub.rs 中： pub fn sub(x: i32, y: i32) -> i32 { super::add::add(x, -y)
} 或者使用 src/math/mod.rs 重新导出的 add： pub fn sub(x: i32, y: i32) -> i32 { super::add(x, -y)
} 或者简单地导入 add 模块下的所有东西： pub fn sub(x: i32, y: i32) -> i32 { use super::add::*; add(x, -y)
} 请注意，函数有它自己的作用域，所以 use 不会影响这个模块其他地方。 你甚至可以用 {} 限制作用域！ pub fn sub(x: i32, y: i32) -> i32 { let add = "something else"; let res = { // 在这个代码块中，`add` 是 `add` 模块导出的函数 use super::add::*; add(x, -y) }; // 现在我们离开代码块，`add` 又变为 "something else" res
}
